import React from "react";
import "./App.css";
import Aux from "../src/com/fplan/hoc/Aux";
import HomePage from "../src/com/fplan/components/generalhome/HomePage";
import Auth from "../src/com/fplan/components/signing/Auth";
import { Route, Switch } from "react-router-dom";
import UserDashBoard from "../src/com/fplan/components/dashboard/UserDashboard";
import SignUpSuccess from "../src/com/fplan/components/signing/SignUpSuccess";
import HomeBackImage from "../src/assets/images/white-clouds.jpg";

const App = (props) => {
  let routes = (
    <Switch>
      <Route path="/signup" component={Auth}></Route>
      <Route path="/signin" component={Auth}></Route>
      <Route path="/signinsuccess" component={UserDashBoard}></Route>
      <Route path="/signupsuccess" component={SignUpSuccess}></Route>
      <Route path="/" component={HomePage}></Route>
    </Switch>
  );

  return (
    <Aux styles={{ backgroundImage: `url(${HomeBackImage})` }}>
      <div className="App">{routes}</div>
    </Aux>
  );
};

export default App;
